INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (0.0, "2030/12/17 14:59:59", 4, 24015, 24, 0.0, 1, 0.0, 110501, 10021, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2019/07/31 12:00:00", "カオリ（サマー）", 4);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (0.0, "2030/12/17 14:59:59", 1, 24016, 24, 0.0, 2, 4.0, 110501, 10021, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2019/07/31 12:00:00", "カオリ（サマー）", 4);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (0.0, "2030/12/17 14:59:59", 4, 24017, 24, 0.0, 3, 0.0, 110501, 10021, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2019/07/31 12:00:00", "カオリ（サマー）", 4);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (0.0, "2030/12/17 14:59:59", 2, 24018, 24, 0.0, 4, 5.2, 110501, 10021, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2019/07/31 12:00:00", "カオリ（サマー）", 1);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (0.0, "2030/12/17 14:59:59", 6, 24019, 24, 0.0, 5, 4.2, 110501, 10021, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2019/07/31 12:00:00", "カオリ（サマー）", 5);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (0.0, "2030/12/17 14:59:59", 2, 24020, 24, 0.0, 6, 0.0, 110501, 10021, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2019/07/31 12:00:00", "カオリ（サマー）", 2);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (0.0, "2030/12/17 14:59:59", 6, 24021, 24, 0.0, 7, 6.4, 110501, 10021, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2019/07/31 12:00:00", "カオリ（サマー）", 1);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (0.0, "2030/12/17 14:59:59", 2, 24022, 24, 0.0, 8, 0.0, 110501, 10021, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2019/07/31 12:00:00", "カオリ（サマー）", 2);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (0.0, "2030/12/17 14:59:59", 3, 24023, 24, 0.0, 9, 10.08, 110501, 10021, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2019/07/31 12:00:00", "カオリ（サマー）", 6);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (0.0, "2030/12/17 14:59:59", 2, 24024, 24, 0.0, 10, 5.0, 110501, 10021, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2019/07/31 12:00:00", "カオリ（サマー）", 1);
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (0.0, "2030/12/17 14:59:59", 2, 24025, 24, 0.0, 11, 0.0, 110501, 10021, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2019/07/31 12:00:00", "カオリ（サマー）", 2);
